import React, {useState} from "react";
import walmartData from "./../../walmartData.json" 

import FirstBlockComponent from "./FirstBlockComponent";
import SecondBlockComponent from "./SecondBlockComponent";
import ThirdBlockComponent from "./ThirdBlockComponent";


function MainComponent() {

    const [data,setData] = useState([]);

    const getData = () => {
        setData(walmartData);
        console.log(data)
    }

    return (
        <>
        <div>
            <h1>Nagłówek h1</h1>
        </div>

        <div>
            <div>
                <FirstBlockComponent/>
            </div>
            <div>
                <SecondBlockComponent/>
            </div>
            <div>
                <ThirdBlockComponent/>
            </div>
            <button onClick={getData}>Przycisk</button>
            {console.log(walmartData.walmart)}


        </div>
        </>
    )
}

export default MainComponent
